import React from 'react'
import classes from './Classes.module.css';
import thumb1 from '../../assets/footer-gallery-thumb-1.jpg';
import thumb2 from '../../assets/footer-gallery-thumb-2.jpg';
import thumb3 from '../../assets/footer-gallery-thumb-3.jpg';
import thumb4 from '../../assets//footer-gallery-thumb-4.jpg';
import thumb5 from '../../assets/footer-gallery-thumb-5.jpg';
import thumb6 from '../../assets/footer-gallery-thumb-6.jpg';
import thumb7 from '../../assets/footer-gallery-thumb-7.jpg';
import thumb8 from '../../assets/footer-gallery-thumb-8.jpg';
import thumb9 from '../../assets/footer-gallery-thumb-9.jpg';

const Classes = () => {
  return (
    <div className={classes.classes}>
      <div className={classes.sideBar}>
        <h3>OTHER SECTIONS</h3>
        <div className={classes.images}>
          <div className={classes.div1}>FITNESS</div>
          <div className={classes.div2}>CROSSFIT</div>
          <div className={classes.div3}>CARDIO</div>
        </div>
        <div>
          <h3>Instagram</h3>
          <div className={classes.pictures}>
            <ul>
              <li><img src={thumb1} alt="" /></li>
              <li><img src={thumb2} alt="" /></li>
              <li><img src={thumb3} alt="" /></li>
            </ul>
            <ul>
              <li><img src={thumb4} alt="" /></li>
              <li><img src={thumb5} alt="" /></li>
              <li><img src={thumb6} alt="" /></li>
            </ul>
            <ul>
              <li><img src={thumb7} alt="" /></li>
              <li><img src={thumb8} alt="" /></li>
              <li><img src={thumb9} alt="" /></li>
            </ul>
          </div>
        </div>
      </div>
      <div className={classes.mainBar}></div>
    </div>
  )
}

export default Classes;
